import React, { Component } from 'react';
import { Layout, Menu, Breadcrumb} from 'antd';

class HeaderList extends Component {
    state = {  }
    render() { 
        return ( 
            <Menu
        theme="dark"
        mode="horizontal"
        defaultSelectedKeys={['1']}
        style={{ lineHeight: '64px' }}
      >
        <Menu.Item key="1"><Link to={'/ListContent'}>全部文章</Link></Menu.Item>
        <Menu.Item key="2"><Link to={'/OldNew'}>已发表</Link></Menu.Item>
        <Menu.Item key="3">草稿箱</Menu.Item>
        <Menu.Item key="4">回收站</Menu.Item>
        <Menu.Item key="5">博客管理</Menu.Item>
        <Menu.Item key="6">博客配置</Menu.Item>
      </Menu>
         );
    }
}
 
export default HeaderList;
